import React from "react";
import {Link} from "react-router-dom";

function Nav() {
    return (
        <nav className="h-20 w-screen bg-blue-200 flex justify-center shadow-lg">

            <div className="w-7/8 h-full">
                <ul className="list-none" role="navigation">
                    <li>
                        <Link to="/"> Home </Link>
                    </li>

                    <li>
                        <Link to="/new"> New Question </Link>
                    </li>

                    <li>
                        <Link to="/board"> Leader Board </Link>
                    </li>
                </ul>
            </div>
        </nav>
    );
}

export default Nav;
